    <div class="modal fade project-modal" id="project-1-1" tabindex="-1" role="dialog" aria-labelledby="myModalLabel">
        <div class="modal-dialog" role="document">
            <div class="modal-content">
                <div class="modal-body"> <button type="button" class="close" data-dismiss="modal" aria-label="Close"> <span aria-hidden="true">×</span> </button>
                    <h2 class="section-heading">Adobe Analytics</h2>
                    <div class="project-content editor-content">
                        <p>Adobe Analytics processes billions of transactions a day across major web and mobile properties. In recent years they have modernised their batch processing stack by adopting new technologies like Hadoop, MapReduce, Spark etc. In this project we will see how Spark and Scala are useful in refactoring process. Spark allows you to define arbitrarily complex processing pipelines without the need for external coordination. It also has support for stateful streaming aggregations and we could reduce our latency using micro-batches of seconds instead of minutes. With the help of Scala and Spark we are able to perform a wide range of operations like batch, streaming, stateful aggregations and analytics, and ETL jobs, just to name a few.</p>
                    </div>
                </div>
            </div>
        </div>
    </div>
    <div class="modal fade project-modal" id="project-1-2" tabindex="-1" role="dialog" aria-labelledby="myModalLabel">
        <div class="modal-dialog" role="document">
            <div class="modal-content">
                <div class="modal-body"> <button type="button" class="close" data-dismiss="modal" aria-label="Close"> <span aria-hidden="true">×</span> </button>
                    <h2 class="section-heading">Interactive Analytics</h2>
                    <div class="project-content editor-content">
                        <p>Apache Spark has many features like, Fog computing, IOT and MLib, GraphX etc. Among the most notable features of Apache Spark is its ability to support interactive analysis. Unlike MapReduce that supports batch processing, Apache Spark processes data faster because of which it can process exploratory queries without sampling. Spark provides an easy way to study API and also it is a strong tool for interactive data analysis. It is available in Scala. MapReduce is made to handle batch processing and SQl on Hadoop engines which are usually slow. Hence it is fast to perform any identification queries against live data without sampling and is highly interactive. Structured streaming is also a new feature that helps in web analytics by allowing customers to run user-friendly query with web visitors.</p>
                    </div>
                </div>
            </div>
        </div>
    </div>
