                    <h2 class="section-heading">Personalizing news pages for Web visitors in Yahoo</h2>
                    <div class="project-content editor-content">
                        <p>Various Spark projects are running in Yahoo for different applications. For personalizing news pages, Yahoo uses ML algorithms which run on Spark to figure out what individual users are interested in, and also to categorize news stories as they arise to figure out what types of users would be interested in reading them. To do this, Yahoo wrote a Spark ML algorithm 120 lines of Scala. (Previously, its ML algorithm for news personalization was written in 15,000 lines of C++.) With just 30 minutes of training on a large, hundred million record data set, the Scala ML algorithm was ready for business.</p>
