                    <div class="cert-and-exam-section" id="certification-process-career-scope-and-salary">
                        <h3>Career Scope and Salary</h3>
                        <div class="panel-group accordion seo-content-accordion-3" role="tablist" aria-multiselectable="true">
                            <div class="panel panel-default">
                                <div class="panel-heading active" role="tab" id="seo-content-heading-3-1">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-1" aria-expanded="false" aria-controls="seo-content-3-1">How will this Spark Scala training help me in getting a job?</a> </h4>
                                </div>
                                <div id="seo-content-3-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-3-1">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark is a Big Data framework which is in high demand. Spark provides streaming as well as batch capabilities, making it one of the biggest revolutionary changes in the environment of Big Data processing. Hence, it is an ideal framework for people and organizations who are looking for speed data analysis. <br><br>Learning this framework will help you climb up the ladder of your career as nowadays more and more companies are eager to adopt Spark in their system.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
