                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-2" aria-expanded="false" aria-controls="seo-content-3-2">What are the career benefits of learning Apache Spark and Scala?</a> </h4>
                                </div>
                                <div id="seo-content-3-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-2">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>According to the Data Science Salary Survey by O’Reilly, there exists a strong link between professionals who utilize Spark and Scala and the change in their salaries. The survey has shown that professionals with Apache Spark skills added $11,000 to the median or average salary, while Scala programming language affected an increase of $4000 to the bottom line of a professional’s salary.<br><br>Apache Spark developers have been known to earn the highest average salary among other programmers utilizing ten of the most prominent Hadoop development tools. Real-time big data applications are going mainstream faster and enterprises are generating data at an unforeseen and rapid rate. This is the best time for professionals to learn Apache Spark online and help companies progress in complex data analysis.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-3-3">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-3" aria-expanded="false" aria-controls="seo-content-3-3">What is the future of Apache Spark?</a> </h4>
                                </div>
                                <div id="seo-content-3-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-3">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark has a bright future:<br></p>
                                            <ul>
                                                <li>Many companies have recognized the power of Spark and quickly started working on it. More and more companies have started using Spark. In upcoming days Spark will be the most trending technology and there will be huge scope for Spark developers.</li>
                                                <li>Apache Spark is the most advanced and popular product of Apache Community that provides the provision to work with streaming data, has various Machine learning libraries, can work on structured and unstructured data, deal with graphs, etc.</li>
                                                <li>Apache Spark is one of the most active projects of Apache and its future scope will be long-lasting.</li>
                                                <li>Spark users have exponentially increased and are considered as the future of Big Data Platform</li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-3-4">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-4" aria-expanded="false" aria-controls="seo-content-3-4">What will be the end result of doing this Spark course?</a> </h4>
                                </div>
                                <div id="seo-content-3-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-4">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>After completing the Apache Spark and Scala course, you will be able to:<br></p>
                                            <p> </p>
                                            <ul>
                                                <li>Understand the fundamentals of Scala programming language along with its features</li>
                                                <li>Master the use of Resilient Distributed Datasets (RDD) to create applications in Spark</li>
                                                <li>Get a proper understanding of the streaming features of Spark</li>
                                                <li>Master the features of Spark ML programming and GraphX programming</li>
                                                <li>Know the limitations of MapReduce and how Spark is used to overcome these limitations.</li>
                                                <li>Learn and master how Spark can be installed as a standalone cluster</li>
                                                <li>Acquire the knowledge of SQL using SparkSQL</li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-3-5">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-5" aria-expanded="false" aria-controls="seo-content-3-5">How much do Apache Spark employees make?</a> </h4>
                                </div>
                                <div id="seo-content-3-5" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-5">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>According to <a href="https://www.indeed.com/salaries/Apache-Spark-Developer-Salaries" target="_blank" rel="nofollow">Indeed.com</a>, the average salary for an Apache Spark developer ranges from approximately $97,915 per year for Developer to $133,184 per year for Data Engineer.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-3-6">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-6" aria-expanded="false" aria-controls="seo-content-3-6">Why is there an increased demand for Spark professionals?</a> </h4>
                                </div>
                                <div id="seo-content-3-6" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-6">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>There is a huge demand for Apache Spark professionals today. With the increasing needs for rapid analysis and processing of Big Data, Spark, the in-memory stack, is being preferred as a faster and simpler alternative to MapReduce, either within a Hadoop framework or outside it. <br><br>Therefore, Big Data enthusiasts with in-depth knowledge of Spark are hugely rewarded by employers.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-3-7">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-7" aria-expanded="false" aria-controls="seo-content-3-7">Which types of companies are hiring Spark developers?</a> </h4>
                                </div>
                                <div id="seo-content-3-7" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-7">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Facebook, Twitter, Linkedin, Yahoo, eBay, Alibaba, Cloudspace, Fox Audience Network, Adobe, etc. are some of the companies who are hiring Spark developers. There is also a great demand for Spark developers and architects from the Retail industry, Manufacturing, Healthcare, Banking, and Finance industries.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div class="cert-and-exam-section" id="certification-process-use-of-apache-spark">
                        <h3>Use of Apache Spark</h3>
                        <div class="panel-group accordion seo-content-accordion-4" role="tablist" aria-multiselectable="true">
                            <div class="panel panel-default">
                                <div class="panel-heading active" role="tab" id="seo-content-heading-4-1">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-1" aria-expanded="false" aria-controls="seo-content-4-1">Why is Apache Spark used?</a> </h4>
                                </div>
                                <div id="seo-content-4-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-4-1">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark has a few big value propositions:</p>
                                            <ul>
                                                <li>It can run on Hadoop with YARN to work with MASSIVE data sets in a distributed fashion.</li>
                                            </ul>
                                            <ul>
                                                <li> It not only works mostly (if not all) in-memory, thus reducing the latency associated with Disk I/O, but it can be run with a Streaming Context (micro-batches) that processes data nearly on arrival.</li>
                                            </ul>
                                            <ul>
                                                <li>It is open source, as is Hadoop, and can run on commodity hardware.</li>
                                            </ul>
                                            <ul>
                                                <li>Lastly, it has an incredibly extensible API that makes it extremely easy to write code around data fast. You can have a very good analytics application shipped in a matter of days…the development time is super-fast.</li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-4-2">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-2" aria-expanded="false" aria-controls="seo-content-4-2">Why is Apache Spark so popular?</a> </h4>
                                </div>
                                <div id="seo-content-4-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-2">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark is one of the most popular projects in the Hadoop Ecosystem and is, in fact, the most actively developed open source project in Big data. And, it continues to attract more and more people every day.<br><br></p>
                                            <p>It is popular not just among Data Scientists but also among Engineers, Developers and everybody else interested in Big Data. It is so popular that a lot of people believe it will grow to replace Map Reduce entirely.<br><br></p>
                                            <p>It is popular because of three things: Simplicity, Performance, and Flexibility.<br><br></p>
                                            <p>A few things why &nbsp;Spark is so popular :<br><br></p>
                                            <ul>
                                                <li>One of the major strengths of Spark is its easy integration with the Hadoop ecosystem.</li>
                                            </ul>
                                            <ul>
                                                <li>Spark, written in Scala, embeds in all JVM-based systems. Also, it provides an interactive REPL, Spark-shell, making it easy to test simple &nbsp;programs</li>
                                            </ul>
                                            <ul>
                                                <li>It has API's in Python and Java apart from the native Scala. This makes application development very easy and it makes Spark a great platform for developers.</li>
                                            </ul>
                                            <ul>
                                                <li>It comes with a Machine learning library MLlib making it very easy for a lot of people to start with and is ideally suited to ML applications.</li>
                                            </ul>
                                            <p>With all these features, Spark has become the center of attraction for almost all of the Big Data developers and Data scientists. Though it has only been a few years, Spark has been evolving quickly and promises to be a sure contender for an industry standard in Big Data.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-4-3">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-3" aria-expanded="false" aria-controls="seo-content-4-3">What are the benefits of Apache Spark?</a> </h4>
                                </div>
                                <div id="seo-content-4-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-3">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>The advantages/benefits of Apache Spark are:-<br><br></p>
                                            <p><strong>Integration with Hadoop<br><br></strong></p>
                                            <p>Spark’s framework is built on top of the Hadoop Distributed File System (HDFS). So it’s advantageous for those who are familiar with Hadoop.</p>
                                            <p><strong><br>Faster<br><br></strong></p>
                                            <p>Spark also starts with the same concept of being able to run MapReduce jobs except that it first places the data into RDDs (Resilient Distributed Datasets). This data is now stored in memory so it’s more quickly accessible i.e. the same MapReduce jobs can run much faster because the data is accessed in memory.<br><br></p>
                                            <p><strong>Real-time stream processing<br><br></strong></p>
                                            <p>Every year, the real-time data being collected from various sources keeps shooting up exponentially. This is where processing and manipulating real-time data can help us. Spark helps us to analyze real-time data as and when it is collected.<br><br></p>
                                            <p>Applications are fraud detection, electronic trading data, log processing in live streams (website logs), etc.<br><br></p>
                                            <p><strong>Graph Processing<br><br></strong></p>
                                            <p>Apart from Steam Processing, Spark can also be used for graph processing. From advertising to social data analysis, graph processing capture relationships in data between entities, say people and objects which are then are mapped out. This has led to recent advances in machine learning and data mining.<br><br></p>
                                            <p><strong>Powerful<br><br></strong></p>
                                            <p> </p>
                                            <p>Today companies manage two different systems to handle their data and hence end up building separate applications for it. One for streaming &amp; storing real-time data. The other to manipulate and analyze this data. This means a lot of space and computational time. Spark gives us the flexibility to implement both batch and stream processing of data simultaneously, which allows organizations to simplify deployment, maintenance and application development.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-4-4">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-4" aria-expanded="false" aria-controls="seo-content-4-4">Which organizations are using Apache Spark?</a> </h4>
                                </div>
                                <div id="seo-content-4-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-4">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Top Companies Using Spark</p>
                                            <ul>
                                                <li><b>Microsoft</b></li>
                                            </ul>
                                            <p>Including Spark support to Azure HDInsight (its cloud-hosted version of Hadoop).</p>
                                            <ul>
                                                <li><b>IBM</b></li>
                                            </ul>
                                            <p>To manage its SystemML machine learning algorithm construction, IBM uses Spark technology.</p>
                                            <ul>
                                                <li><b>Amazon</b></li>
                                            </ul>
                                            <p>To run Spark apps developed in Scala, Java, and Python, Amazon uses Apache Spark.</p>
                                            <ul>
                                                <li><b>Yahoo!</b></li>
                                            </ul>
                                            <p>Yahoo used to have the origin in Hadoop for analyzing big data. Nowadays, Apache Spark is the next cornerstone.</p>
                                            <p>Apart from them many more names like:</p>
                                            <ul>
                                                <li>Conviva</li>
                                                <li>Netflix</li>
                                                <li>Pinterest</li>
                                                <li>Oracle</li>
                                                <li>Hortonworks</li>
                                                <li>Cisco</li>
                                                <li>Verizon</li>
                                                <li>Visa</li>
                                                <li>Databricks</li>
                                                <li>Amazon</li>
                                                <li>Accenture PLC</li>
                                                <li>Paxata</li>
                                                <li>DataStax, Inc.</li>
                                                <li>UC Berkeley AMPLab</li>
                                                <li>TripAdvisor</li>
                                                <li>Samsung Research America</li>
                                                <li>Shopify</li>
                                                <li>Premise</li>
                                                <li>Quantifind</li>
                                                <li>Radius Intelligence</li>
                                                <li>OpenTable</li>
                                                <li>Hitachi Solutions</li>
                                                <li>The Hive</li>
                                                <li>IBM Almaden</li>
                                                <li>eBay!</li>
                                                <li>Bizo and many more</li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-4-5">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-5" aria-expanded="false" aria-controls="seo-content-4-5">Why are data scientists using Apache Spark?</a> </h4>
                                </div>
                                <div id="seo-content-4-5" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-5">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <ul>
                                                <li>Apache Spark is the go-to tool for Data Science at scale. It is an open source, distributed compute platform which is the first tool in the Data Science toolbox which is built specifically with Data Science in mind.<br></li>
                                                <li>Spark is different from the myriad other solutions to this problem because it allows Data Scientists to develop simple code to perform distributed computing, and the functionality available in Spark is growing at an incredible rate.</li>
                                                <li>Much has been made in the Data Science community around Spark’s ability to train Machine Learning models at scale, and this is a key benefit, but&nbsp; the real value comes from being able to put an entire analytics pipeline into Spark, right from the data ingestion and ETL processes, through the data wrangling and feature engineering processes through to training and execution of models.</li>
                                                <li>What’s more, with Spark streaming and graphx Spark can provide a much more complete analytics solution.</li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div class="cert-and-exam-section" id="certification-process-spark-installation">
                        <h3>Spark Installation</h3>
                        <div class="panel-group accordion seo-content-accordion-5" role="tablist" aria-multiselectable="true">
                            <div class="panel panel-default">
                                <div class="panel-heading active" role="tab" id="seo-content-heading-5-1">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-5" href="#seo-content-5-1" aria-expanded="false" aria-controls="seo-content-5-1">What are the tools and technologies required to run the Apache Spark Program?</a> </h4>
                                </div>
                                <div id="seo-content-5-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-5-1">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark 2.3, SBT, Eclipse, Scala, IntelliJ Idea, PySpark(for Spark with Python)</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-5-2">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-5" href="#seo-content-5-2" aria-expanded="false" aria-controls="seo-content-5-2">How do I install Apache Spark?</a> </h4>
                                </div>
                                <div id="seo-content-5-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-5-2">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Follow the below steps given below for installing Spark.</p>
                                            <ul>
                                                <li>Extracting Spark tar file using following command –</li>
                                            </ul>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;$ tar xvf spark-2.4.3-bin-hadoop2.7.3.tgz</p>
                                            <ul>
                                                <li>Move Spark software files to respective directory using following commands –</li>
                                            </ul>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;/usr/local/spark</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;# cd /home/Hadoop/Downloads/</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;# mv spark-2.4.3-bin-hadoop2.7.3 /usr/local/spark</p>
                                            <ul>
                                                <li>Add the following line to a ~/.bashrc file which will add the location, where the spark software files are located to the PATH variable type.</li>
                                            </ul>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;export PATH = $PATH:/usr/local/spark/bin</p>
                                            <ul>
                                                <li>Use the following below command for sourcing the ~/.bashrc file.</li>
                                            </ul>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;$ source ~/.bashrc</p>
                                            <ul>
                                                <li>Verify the Installation of Spark application on your system</li>
                                                <li>The following command will open the Spark shell application version.</li>
                                            </ul>
                                            <p> </p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;$spark-shell</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-5-3">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-5" href="#seo-content-5-3" aria-expanded="false" aria-controls="seo-content-5-3">How to verify Spark installation?</a> </h4>
                                </div>
                                <div id="seo-content-5-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-5-3">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Verify the Installation of Spark application on your system</p>
                                            <p>The following command will open the Spark shell application version:<br><br></p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;$spark-shell<br><br></p>
                                            <p>If spark is installed successfully then you will be getting the following output.<br><br></p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Spark assembly has been built with Hive, including Datanucleus jars on classpath</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Using Spark’s default log4j profile: org/apache/spark/log4j-defaults.properties</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;12/04/19 15:25:22 INFO SecurityManager: Changing view acls to: hadoop</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;12/04/19 15:25:22 INFO SecurityManager: Changing modify acls to: hadoop</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;12/04/04 15:25:22 INFO SecurityManager: SecurityManager: authentication disabled;</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ui acls disabled; users with view permissions: Set(hadoop); users with modify permissions: Set(hadoop)</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;12/04/19 15:25:22 INFO HttpServer: Starting HTTP Server</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;12/04/19 15:25:23 INFO Utils: Successfully started service naming ‘HTTP class server’ on port 43292.</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Welcome to the Spark World</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Initializing Spark in Scala</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;import org.apache.spark.SparkConf</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;import org.apache.spark.SparkContext</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;import org.apache.spark.SparkContext._</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;val conf = new SparkConf().setMaster("local").setAppName("My App")</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;val sc = new SparkContext(conf)</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Initializing Spark in Java</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;import org.apache.spark.SparkConf;</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;import org.apache.spark.api.java.JavaSparkContext;</p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;SparkConf conf = new SparkConf().setMaster("local").setAppName("My App");</p>
                                            <p> </p>
                                            <p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;JavaSparkContext sc = new JavaSparkContext(conf);</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div class="cert-and-exam-section" id="certification-process-apache-spark-and-scala">
                        <h3>Apache Spark and Scala</h3>
                        <div class="panel-group accordion seo-content-accordion-6" role="tablist" aria-multiselectable="true">
                            <div class="panel panel-default">
                                <div class="panel-heading active" role="tab" id="seo-content-heading-6-1">
                                    <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-1" aria-expanded="false" aria-controls="seo-content-6-1">What exactly is Apache Spark?</a> </h4>
                                </div>
                                <div id="seo-content-6-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-6-1">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark is an open-source parallel processing framework for running large-scale data analytics applications across clustered computers. It can handle both batch and real-time analytics and data processing workloads.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-2">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-2" aria-expanded="false" aria-controls="seo-content-6-2">How does Apache Spark work?</a> </h4>
                                </div>
                                <div id="seo-content-6-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-2">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark can process data from a variety of data repositories, including the Hadoop Distributed File System (HDFS), NoSQL databases and relational data stores, such as Apache Hive. Spark supports in-memory processing to boost the performance of big data analytics applications, but it can also perform conventional disk-based processing when data sets are too large to fit into the available system memory.<br><br></p>
                                            <p>The Spark Core engine uses the resilient distributed data set, or RDD, as its basic data type. The RDD is designed in such a way so as to hide much of the computational complexity from users. It aggregates data and partitions it across a server cluster, where it can then be computed and either moved to a different data store or run through an analytic model. The user doesn't have to define where specific files are sent or what computational resources are used to store or retrieve files.<br><br></p>
                                            <p>In addition, Spark can handle more than the batch processing applications that MapReduce is limited to running.<br><br></p>
                                            <p><b>Spark Libraries<br></b>The Spark Core engine functions partly as an application programming interface (API) layer and underpins a set of related tools for managing and analyzing data. Aside from the Spark Core processing engine, the Apache Spark API environment comes packaged with some libraries of code for use in data analytics applications. These libraries include:<b><br></b></p>
                                            <p><br></p>
                                            <p><b>Spark SQL<br></b>One of the most commonly used libraries, Spark SQL enables users to query data stored in disparate applications using the common SQL language.<b><br></b></p>
                                            <p><br></p>
                                            <p><b>Spark Streaming<br></b>This library enables users to build applications that analyze and present data in real time.</p>
                                            <p><br></p>
                                            <p><b>MLlib<br></b>A library of machine learning code that enables users to apply advanced statistical operations to data in their Spark cluster and to build applications around these analyses.<br><br></p>
                                            <p> </p>
                                            <p><b>GraphX<br></b>A built-in library of algorithms for graph-parallel computation.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-3">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-3" aria-expanded="false" aria-controls="seo-content-6-3">Is Spark a framework or programming language?</a> </h4>
                                </div>
                                <div id="seo-content-6-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-3">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark is a general purpose cluster-computing framework that can be deployed by multiple ways like streaming data, graph processing and Machine learning.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-4">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-4" aria-expanded="false" aria-controls="seo-content-6-4">What are the features of Apache Spark?</a> </h4>
                                </div>
                                <div id="seo-content-6-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-4">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Features of Spark are –</p>
                                            <p> </p>
                                            <ol>
                                                <li>Lighting Fast Processing</li>
                                                <li>Support for Sophisticated Analytics</li>
                                                <li>Real-Time Stream Processing</li>
                                                <li>Ability to Integrate with Hadoop and Existing Hadoop Data</li>
                                                <li>Active and Expanding Community</li>
                                            </ol>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-5">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-5" aria-expanded="false" aria-controls="seo-content-6-5">What are the different components of the Apache Spark Ecosystem?</a> </h4>
                                </div>
                                <div id="seo-content-6-5" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-5">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>The different components of Apache Spark are:-</p>
                                            <p><br><b>Spark Libraries<br></b>The Spark Core engine functions partly as an application programming interface (API) layer and underpins a set of related tools for managing and analyzing data. Aside from the Spark Core processing engine, the Apache Spark API environment comes packaged with some libraries of code for use in data analytics applications. These libraries include:</p>
                                            <p><br></p>
                                            <p><b>Spark SQL<br></b>One of the most commonly used libraries, Spark SQL enables users to query data stored in disparate applications using the common SQL language.<br><br></p>
                                            <p><b>Spark Streaming<br></b>This library enables users to build applications that analyze and present data in real time.<br><br></p>
                                            <p><b>MLlib<br></b>A library of machine learning code that enables users to apply advanced statistical operations to data in their Spark cluster and to build applications around these analyses.<br><br></p>
                                            <p> </p>
                                            <p><b>GraphX<br></b>A built-in library of algorithms for graph-parallel computation.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-6">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-6" aria-expanded="false" aria-controls="seo-content-6-6">What sets Apache Spark Apart?</a> </h4>
                                </div>
                                <div id="seo-content-6-6" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-6">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <ul>
                                                <li>Apache Spark can handle both batch and real-time analytics and data processing workloads.</li>
                                            </ul>
                                            <ul>
                                                <li>Apache Spark can process data from a variety of data repositories, including the Hadoop Distributed File System (HDFS), NoSQL databases and relational data stores, such as Apache Hive.</li>
                                            </ul>
                                            <ul>
                                                <li>Spark supports in-memory processing to boost the performance of big data analytics applications</li>
                                            </ul>
                                            <ul>
                                                <li>Spark is 100 times faster than Map Reduce</li>
                                            </ul>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-7">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-7" aria-expanded="false" aria-controls="seo-content-6-7">What languages can be used in Apache Spark?</a> </h4>
                                </div>
                                <div id="seo-content-6-7" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-7">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark supports Java, Scala, Python APIs.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-8">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-8" aria-expanded="false" aria-controls="seo-content-6-8">What is the best language to use for Apache Spark and Why?</a> </h4>
                                </div>
                                <div id="seo-content-6-8" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-8">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Scala is the language of the future and is the best language to learn for Apache Spark. Apache Spark is completely written in Scala.<br><br></p>
                                            <p>Spark supports the Scala APIs as Spark is written completely in Scala. Hence Spark programs written in Scala might have some performance benefits. Since Scala is based on JVM, it is native for Hadoop and so seamlessly work with it. And, in almost all cases, it outperforms Python.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-9">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-9" aria-expanded="false" aria-controls="seo-content-6-9">What is Scala?</a> </h4>
                                </div>
                                <div id="seo-content-6-9" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-9">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Scala is the most upcoming programming language. Scala combines object-oriented and functional programming in one concise, high-level language. Scala's static types help avoid bugs in complex applications, and its JVM and JavaScript runtimes let you build high-performance systems with easy access to huge ecosystems of libraries.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-10">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-10" aria-expanded="false" aria-controls="seo-content-6-10">What is the difference between Spark and Scala?</a> </h4>
                                </div>
                                <div id="seo-content-6-10" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-10">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>The main difference between Spark and Scala is that the Apache Spark is a cluster computing framework designed for fast Hadoop computation while the Scala is a general-purpose programming language that supports functional and object-oriented programming.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-11">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-11" aria-expanded="false" aria-controls="seo-content-6-11">Why is Apache Spark implemented in Scala?</a> </h4>
                                </div>
                                <div id="seo-content-6-11" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-11">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark is implemented in Scala because Scala combines object-oriented and functional programming in one concise, high-level language. Scala's static types help avoid bugs in complex applications, and its JVM and JavaScript runtimes let you build high-performance systems with easy access to huge ecosystems of libraries.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-12">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-12" aria-expanded="false" aria-controls="seo-content-6-12">Is Scala necessary for Spark?</a> </h4>
                                </div>
                                <div id="seo-content-6-12" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-12">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>No. Spark programs can be written using Java and Python too.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-13">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-13" aria-expanded="false" aria-controls="seo-content-6-13">How important is Apache Spark &amp; Scala in the BigData industry?</a> </h4>
                                </div>
                                <div id="seo-content-6-13" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-13">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Apache Spark in widely considered as the future of the Big Data platform. When Spark stepped into the Big data industry, it has met the enterprises’ expectations in a better way with respect to data processing, querying analytics reports in a faster way.<br><br></p>
                                            <p> </p>
                                            <p>Spark is written in Scala and Scala gives you access to many advanced features of Spark.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-14">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-14" aria-expanded="false" aria-controls="seo-content-6-14">Is Apache Spark open source?</a> </h4>
                                </div>
                                <div id="seo-content-6-14" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-14">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Yes, Spark is an open source, cluster-computing framework which supports various programming languages like Scala, Python, Java and R.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="seo-content-heading-6-15">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-6" href="#seo-content-6-15" aria-expanded="false" aria-controls="seo-content-6-15">What are the applications of Apache Spark?</a> </h4>
                                </div>
                                <div id="seo-content-6-15" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-6-15">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Some of the great applications of Apache Spark are:<br><br></p>
                                            <p>Spark is a widely-used technology adopted by most of the industries. Some of the prominent applications of Apache Spark are –<br><br></p>
                                            <p><b>Machine Learning – </b>Apache Spark is equipped with a scalable Machine Learning Library called &nbsp;MLlib that can perform advanced analytics such as clustering, classification, dimensionality reduction, etc. Some of the prominent analytics jobs like predictive analysis, customer segmentation, sentiment analysis, etc., make Spark an intelligent technology.<br><br></p>
                                            <p><b>Fog computing –</b> With the influx of big data concepts, IoT has acquired a prominent space for the invention of more advanced technologies. Based on the theory of connecting digital devices with the help of small sensors this technology deals with a humongous amount of data emanating from numerous mediums. This requires parallel processing which is certainly not possible on cloud computing. Therefore Fog computing which decentralizes the data and storage uses Spark streaming as a solution to this problem.<br><br></p>
                                            <p><b>Event detection </b>– The feature of Spark streaming allows the organization to keep track of rare and unusual behaviors for protecting the system. Institutions like financial institutions, security organizations, and health organizations use triggers to detect the potential risk.<br><br></p>
                                            <p> </p>
                                            <p><b>Interactive analysis –</b> Among the most notable features of Apache Spark is its ability to support interactive analysis. Unlike MapReduce that supports batch processing, Apache Spark processes data faster because of which it can process exploratory queries without sampling.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </section>

