                                    <div class="editor-content">
                                        <p>You will get in-depth knowledge on Apache Spark and the Spark Ecosystem, which includes Spark RDD, Spark SQL, Spark MLlib and Spark Streaming. You will get comprehensive knowledge on Scala Programming language, HDFS, Sqoop, FLume, Spark GraphX and Messaging System such as Kafka.</p>
