                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-1-6">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-6" aria-expanded="false" aria-controls="faq-1-6">Why is this course relevant?</a> </h4>
