                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-7" aria-expanded="false" aria-controls="faq-1-7">What skills can I acquire by learning Apache Spark?</a> </h4>
                            </div>
                            <div id="faq-1-7" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-7">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>KnowledgeHut’s training is intended to enable you to turn into an effective Apache Spark developer. After learning this course, you can acquire skills like-</p>
                                        <p> </p>
                                        <ul>
                                            <li>Write Scala Programs to build Spark Application</li>
                                            <li>Master the concepts of HDFS</li>
                                            <li>Understand Hadoop 2.x Architecture</li>
                                            <li>Understand Spark and its Ecosystem</li>
                                            <li>Implement Spark operations on Spark Shell</li>
                                            <li>Implement Spark applications on YARN (Hadoop)</li>
                                            <li>Write Spark Applications using Spark RDD concepts</li>
                                            <li>Learn data ingestion using Sqoop</li>
                                            <li>Perform SQL queries using Spark SQL</li>
                                            <li>Implement various machine learning algorithms in Spark MLlib API and Clustering</li>
                                            <li>Explain Kafka and its components</li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-1-8">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-8" aria-expanded="false" aria-controls="faq-1-8">What can I expect to accomplish by the end of this course?</a> </h4>
                            </div>
                            <div id="faq-1-8" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-8">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>The Big data explosion has created huge avenues for data analysis and has made it the most sought after career option. There is a huge demand for developers and engineers who can use tools such as Scala and Spark to derive business insights. This course will prepare you for everything you need to learn about Big Data while gaining practical experience in Scala and Spark. &nbsp;After completing our course, you will become proficient in Apache Spark Development.</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-1-9">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-9" aria-expanded="false" aria-controls="faq-1-9">Does this class have any restrictions?</a> </h4>
                            </div>
                            <div id="faq-1-9" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-9">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>There are no restrictions but participants would benefit if they have basic computer knowledge.</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    <h3 id="">Workshop Experience</h3>
                    <div class="panel-group faq-accordion-2" role="tablist" aria-multiselectable="true">
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-1">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-1" aria-expanded="false" aria-controls="faq-2-1">How is the Apache Spark training conducted?</a> </h4>
                            </div>
                            <div id="faq-2-1" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-1">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>All of the training programs conducted by us are interactive in nature and fun to learn as a great amount of time is spent on hands-on practical training, use case discussions, and quizzes. An extensive set of collaborative tools and techniques are used by our trainers which will improve your online training experience.</p>
                                        <p><br></p>
                                        <p>The Apache Spark and Scala training conducted at KnowledgeHut is customized according to the preferences of the learner. The training is conducted in three ways:<br><br><b>Online Classroom training</b>: You can learn from anywhere through the most preferred virtual live and interactive training&nbsp; &nbsp;<br><br><b>Self-paced learning</b>: This way of learning will provide you lifetime access to high-quality, self-paced e-learning materials designed by our team of industry experts<br><br><b>Team/Corporate Training</b>: In this type of training, a company can either pick an employee or entire team to take online or classroom training. Flexible pricing options, standard Learning Management System (LMS), and enterprise dashboard are the add-on features of this training. Moreover, you can customize your curriculum based on your learning needs and also get post-training support from the expert during your real-time project implementation.&nbsp;&nbsp;</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-2">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-2" aria-expanded="false" aria-controls="faq-2-2">How long will it take to complete the course?</a> </h4>
                            </div>
                            <div id="faq-2-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-2">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>The sessions that are conducted are 24 hours of live sessions, with 70+ hours MCQs and Assignments and 23 hours of hands-on sessions.</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-3">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-3" aria-expanded="false" aria-controls="faq-2-3">What things do I need to attend the online Spark classes?</a> </h4>
                            </div>
                            <div id="faq-2-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-3">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>To attend the online Spark classes, the following is the list of essential requirements:</p>
                                        <ul>
                                            <li>Operating system (Mac OS X, Windows or Linux)</li>
                                            <li>A web browser like Chrome, FireFox</li>
                                            <li>Proper internet connection</li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-4">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-4" aria-expanded="false" aria-controls="faq-2-4">Will there be any lab facility available for me?</a> </h4>
                            </div>
                            <div id="faq-2-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-4">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>Yes, our lab facility at KnowledgeHut has the latest version of hardware and software and is very well-equipped. We provide Cloudlabs so that you can get a hands-on experience of the features of Apache Spark. Cloudlabs provides you with real-world scenarios can practice from anywhere around the globe. You will have an opportunity to have live hands-on coding sessions. Moreover, you will be given practice assignments to work on after your class.</p>
                                        <p><br></p>
                                        <p> </p>
                                        <p>Here at KnowledgeHut, we have Cloudlabs for all major categories like cloud computing, web development, and Data Science.</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-5">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-5" aria-expanded="false" aria-controls="faq-2-5">What kind of projects are included as a part of the Apache Spark training?</a> </h4>
                            </div>
                            <div id="faq-2-5" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-5">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>This Apache Spark and Scala training course have three projects, viz Adobe Analysis, Interactive Analysis, and Personalizing news pages for Web visitors in Yahoo.</p>
                                        <p> </p>
                                        <ul>
                                            <li>Adobe Analysis: Adobe Analytics deal with huge amount of transactions in a day across major mobile and web properties. With the help of this project, you’ll come to know how Spark and Scala are useful in refactoring process. &nbsp;&nbsp;</li>
                                            <li>Interactive Analysis: Apache Spark has various features like Fog computing, IOT and MLib, GraphX etc. It’s most notable feature is its ability to support interactive analysis.</li>
                                            <li>Personalizing news pages for Web visitors in Yahoo: Yahoo runs various Spark projects for different applications. Yahoo uses ML algorithms for personalizing news pages.</li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-6">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-6" aria-expanded="false" aria-controls="faq-2-6">What software do I need to install to get started with my project/training?</a> </h4>
                            </div>
                            <div id="faq-2-6" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-6">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>Scala, SBT, Apache Spark ,IntelliJ Idea Community Edition/Eclipse</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-7">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-7" aria-expanded="false" aria-controls="faq-2-7">How is the project completed and how do I get certified?</a> </h4>
                            </div>
                            <div id="faq-2-7" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-7">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>The Learning Management System (LMS) provides you with everything that you need to complete your projects, such as the data points and problem statements. If you are still facing any problems, feel free to contact us.<br><br>After the completion of your course, you will be submitting your project to the trainer. The trainer will be evaluating your project. After a complete evaluation of the project and completion of your online exam, you will be certified a Spark and Scala professional.</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
